import React from 'react';

function PlanetList(props) {
    return (
        <div className = "grid">
    {
    props.planets.map((planet) => (
        <div key={planet.model} className="card">
            <h3> name:{planet.name}</h3>
            <h4>model:{planet.model}</h4>
            <h4> cost: {planet.cost_in_credits}</h4>
            <h4>hyperdrive rating: {planet.hyperdrive_rating}</h4>
        </div>
    ))
    }
    </div>
    );
}

export default PlanetList;
